function searchBar(submitFunction) {
    const handleSubmit = (e) => {
        e.preventDefault()
        submitFunction()
    }

    return (
        <form onSubmit={handleSubmit}>
            <input
                className={"search-input"}
                placeholder={"Search"}
            />
            <input type={"submit"}/>
        </form>
    )
}

const components = {searchBar}
export default components;
